import React from "react";

const Footer = () => {
  return (
    <div class="home_black_version">
      <footer className="footer">
        <div className="container">
          <p>&copy; 2025 Ashirwaad Jewelry. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Footer;
